import react from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";

const Router = () =>{
    return(
        <BrowserRouter>
            <Navigation/>
            <Switch>
                <Route exact path="/"  />
                <Route exact path="/about"  />
                <Route exact path="/services"  />
                <Route exact path="/contact"  />
            </Switch>
        </BrowserRouter>
    );
}
export default Router;
